import React from "react";

function Goal({ goal, index }) {
  console.log(goal);
  return (
    <li className="list__item">
      <div>
        <p>{index + 1}</p>

        {goal.value}
      </div>
      <div className="list__buttons">
        <button className="check-button">✔</button>
        <button className="delete-button">✕ </button>
      </div>
    </li>
  );
}

export default Goal;
